import * as React from 'react';
import { HashRouter,Switch,Route,Redirect } from 'react-router-dom';

import App from "./App";


export const Router = () => (
  <HashRouter>
    <Switch>
      <Route path="/" exact component={App} />
    </Switch>
  </HashRouter>
);
